import React from 'react';
import Layout from '../components/Layout'; 
function LogoutConfirmation() {
  return (
    <Layout>
      <h1>Logout Confirmation</h1>
      <p>You have successfully logged out.</p>
    </Layout>
  );
}

export default LogoutConfirmation;
